import { useAuth0 } from "@auth0/auth0-react";

const LoginAuth = () => {
  const { loginWithRedirect } = useAuth0();
  const { user, isAuthenticated } = useAuth0();
  return (
    <>
      <button
        onClick={() => {
          loginWithRedirect();
        }}
      >
        LoginAuth
      </button>
      {isAuthenticated && (
        <div>
          {console.log(user)}
          <img src={user.picture} alt="" />
          <h1>{user.given_name}</h1>
        </div>
      )}
    </>
  );
};

export default LoginAuth;
